import './App.css';
import Navbars from './components/Navbars';
import Ussection from './components/Ussection';
import Healthysection from './components/Healthy section';
import Trainerssection from './components/Trainerssection';
import Iconsection from './components/Iconsection';
import Footer from './components/Footer';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Sidenavbar from './components/Sidenavbar';
function App() {
  return (
    <div>
      <BrowserRouter>
        <div className='side-n'>
          <Sidenavbar />
        </div>
        <div>
          <Routes>
            <Route path='/' element={<Navbars />} />
            <Route path='/ussection' element={<Ussection />} />
            <Route path='/healthysection' element={<Healthysection />} />

            <Route path='/healthysection/trainerssection' element={<Trainerssection />} />
            <Route path='/healthysection/iconsection' element={<Iconsection />} />
            <Route path='/healthysection/footer' element={<Footer />} />

          </Routes>

          {/* <Navbars />
          <Ussection />
          <Healthysection />
          <Trainerssection />
          <Iconsection />
          <Footer /> */}
        </div>

      </BrowserRouter>
    </div>
  );
}

export default App;
